#' @title  ADMC Nightingale Platform NMR Post-Unblinding Re-Analysis of Lipoproteins and Metabolites 
#'
#'
#'
#'
#'
#'
#' @seealso  \url{https://adni.bitbucket.io/reference/docs/ADNINIGHTINGALE2/10.1515_ijb-2020-0107.pdf}, \url{https://adni.bitbucket.io/reference/docs/ADNINIGHTINGALE2/ADMC_Nightingale_Platform-Methods_Description-2020-update.pdf}, \url{https://adni.bitbucket.io/reference/docs/ADNINIGHTINGALE2/Nightingale_2020_quantification.pdf}
#'
#' @details A dataset with variables as follows:
#'
#' \itemize{
#'   \item RID -4 -4 Participant roster ID
#'   \item VISCODE -4 -4 Visit code
#'   \item VISCODE2 -4 -4 Translated visit code
#'   \item EXAMDATE -4 -4 Examination Date
#'   \item SAMPLEID -4 -4 -4
#'   \item GLOBAL.SPEC.ID -4 -4 -4
#'   \item EDTA_PLASMA -4 -4 Detected EDTA anticoagulant. This indicates a EDTA plasma sample. EDTA anticoagulant interferes with the quantification of glycerol, glycine and pyruvate. Also, metabolites may behave differently (mainly in absolute concentration terms, but potentially also in association terms) in serum and EDTA plasma due to the different biological matrices.
#'   \item CITRATE_PLASMA -4 -4 A non-physiological citrate concentration. This may result from the sample being citrate plasma.
#'   \item LOW_ETHANOL -4 -4 This arises potentially due to disinfectant contaminations in the blood donation/collection process and/or contamination in air from lab handling, such as cleaning of well-plates. In higher concentrations, ethanol prohibits the quantification of glycerol, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample. In lower concentrations, it may interfere with the reliable quantification of glycerol and result in artificially distorted glycerol levels. We recommend caution when interpreting absolute glycerol concentrations. It is also good to note that high alcohol in the sample might artificially increase the acetate concentration.
#'   \item MEDIUM_ETHANOL -4 -4 This arises potentially due to disinfectant contaminations in the blood donation/collection process and/or contamination in air from lab handling, such as cleaning of well-plates. In higher concentrations, ethanol prohibits the quantification of glycerol and 3-hydroxybutyrate, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample. In lower concentrations, it may interfere with the reliable quantification of glycerol and 3-hydroxybutyrate and result in artificially distorted glycerol and 3-hydroxybutyrate levels. We recommend caution when interpreting absolute glycerol and 3-hydroxybutyrate concentrations. It is also good to note that high alcohol in the sample might artificially increase the acetate concentration.
#'   \item HIGH_ETHANOL -4 -4 This arises potentially due to disinfectant contaminations in the blood donation/collection process and/or contamination in air from lab handling, such as cleaning of well-plates. In higher concentrations, ethanol prohibits the quantification of glycerol, 3-hydroxybutyrate and valine, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample. In lower concentrations, it may interfere with the reliable quantification of glycerol, 3-hydroxybutyrate and valine and result in artificially distorted glycerol, 3-hydroxybutyrate and valine levels. We recommend caution when interpreting absolute glycerol, 3-hydroxybutyrate and valine concentrations. It is also good to note that high alcohol in the sample might artificially increase the acetate concentration.
#'   \item ISOPROPYL_ALCOHOL -4 -4 Isopropyl alcohol signals detected. In higher concentrations, this compound prohibits the quantification of creatinine, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample. In lower concentrations, it may interfere with the reliable quantification of creatinine and result in artificially distorted creatinine levels. We recommend caution when interpreting absolute creatinine concentrations.
#'   \item N_METHYL_2_PYRROLIDONE -4 -4 A compound that can be used in sample collection processes. In higher concentrations, it prohibits the quantification of glutamine, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample. In lower concentrations, it may interfere with the reliable quantification of glutamine and result in artificially distorted glutamine levels. We recommend caution when interpreting absolute glutamine concentrations.
#'   \item POLYSACCHARIDES -4 -4 Polysaccharide or some other type of carbohydrate signals detected. Most commonly observed along with other signs of suboptimal sample quality, but may also indicate presence of heparin. In higher concentrations, this compound prohibits the quantification of creatinine, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample. In lower concentrations, it may interfere with the reliable quantification of creatinine and result in artificially distorted creatinine levels. We recommend caution when interpreting absolute creatinine concentrations.
#'   \item AMINOCAPROIC_ACID -4 -4 Aminocaproic acid detected in the sample; this compound is an antifibrinolytic agent. In higher concentrations, it prohibits the quantification of acetone, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample.
#'   \item LOW_GLUCOSE -4 -4 Low glucose is tagged since the physiological concentration is commonly well controlled, particularly in the low concentration end. However, glucose is metabolised to pyruvate and lactate if the blood sample is kept with the cells during the sample collection process, in particular at room temperature but also to some extent at fridge temperature. The low glucose tag thus commonly reflects extended time periods prior to preparation to serum/plasma. As a result of the glycolysis, high lactate and/or high pyruvate is commonly observed along with low glucose levels.
#'   \item HIGH_LACTATE -4 -4 Low glucose is tagged since the physiological concentration is commonly well controlled, particularly in the low concentration end. However, glucose is metabolised to pyruvate and lactate if the blood sample is kept with the cells during the sample collection process, in particular at room temperature but also to some extent at fridge temperature. The low glucose tag thus commonly reflects extended time periods prior to preparation to serum/plasma. As a result of the glycolysis, high lactate and/or high pyruvate is commonly observed along with low glucose levels.
#'   \item HIGH_PYRUVATE -4 -4 Low glucose is tagged since the physiological concentration is commonly well controlled, particularly in the low concentration end. However, glucose is metabolised to pyruvate and lactate if the blood sample is kept with the cells during the sample collection process, in particular at room temperature but also to some extent at fridge temperature. The low glucose tag thus commonly reflects extended time periods prior to preparation to serum/plasma. As a result of the glycolysis, high lactate and/or high pyruvate is commonly observed along with low glucose levels.
#'   \item LOW_GLUTAMINE_OR_HIGH_GLUTAMATE -4 -4 In these samples most of the glutamine appears to have degraded into glutamate. This can take place, e.g. during the sample collection process, if the sample is kept at room temperature for a prolonged period of time, there are multiple freeze-thaw cycles, or there are oxidative conditions / oxidation occurs in the sample. In these samples glutamine is not quantified. In higher concentrations, glutamate prohibits the quantification of pyruvate, and therefore the sample has been flagged with a "TAG", and no concentration has been provided for the sample. In lower concentrations, glutamate may interfere with the reliable quantification of pyruvate and result in artificially distorted pyruvate levels. We recommend caution when interpreting absolute pyruvate concentrations.
#'   \item GLUCONOLACTONE -4 -4 Gluconolactone is an oxidation product of glucose and is not normally detected in samples. Interferes with the quantification of creatinine.
#'   \item LOW_PROTEIN -4 -4 Unexpected protein features have been identified during the analysis. This quality observation is related to unexpectedly low total protein concentration in the sample and may be an indication of potential sample dilution. Sample dilution may occur due to water contamination, or prolonged storage in freezer in combination with loosely closed tube caps, which exposes the sample to collect ice and increases the chances of dilution.In case there is reason to assume sample dilution, we recommend caution when analyzing absolute concentrations.
#'   \item UNEXPECTED_AMINO_ACID_SIGNALS -4 -4 These are signals that we do not typically observe in normal samples. It is likely that they relate to protein breakage due to non optimal storage.Interferes with the reliable quantification of citrate and glycerol, and may result in artificially distorted metabolite concentrations.
#'   \item UNIDENTIFIED_MACROMOLECULES -4 -4 Signals from abnormal macromolecule(s)/protein(s).Interferes with the quantification of phenylalanine, acetate, acetone, glutamine and pyruvate.
#'   \item UNIDENTIFIED_SMALL_MOLECULE_A -4 -4 Untypical signals from unknown small molecule(s); potentially xenobiotics.
#'   \item UNIDENTIFIED_SMALL_MOLECULE_B -4 -4 Untypical signals from unknown small molecule(s); potentially xenobiotics. Interferes with the quantification of acetate.
#'   \item UNIDENTIFIED_SMALL_MOLECULE_C -4 -4 Unidentified signals at 2.27 ppm and various other spectral areas. Interferes with the reliable quantification of albumin, creatinine, glycerol, glycine and acetone.
#'   \item BELOW_LIMIT_OF_QUANTIFICATION -4 -4 Below Limit-Of-Quantification (LOQ) means that the concentration of the given biomarker is smaller than the range where the Nightingale platform offers highly accurate quantification. For instance, the LOQ for lipoprotein lipid measures is < 0.01 mmol/L. The estimated biomarker concentration is reported for use in certain epidemiological analyses, but it may be advisable to conduct sensitivity analyses with all values below LOQ excluded.
#'   \item TOTAL_C -4 mmol/l Total cholesterol
